import React from "react";
import Header from "./Header.jsx";
import Footer from "./Footer.jsx";
import notes from "../notes.js";

function createCard(notes){
    return(
        <div className = "note">
            <Card 
                key = {notes.key}
                title = {notes.title}
                content = {notes.content}
            />
        </div>
    );
}

function  App(){
    return (<div>
        <Header />
        {notes.map(createCard)}
        <Footer />
        </div>);
}

export default App;
